import logging
from enum import Enum, auto
from datetime import datetime
from typing import List, Dict, Optional, Any
import json

# Enumerations
class PublishStatus(Enum):
    DRAFT = auto()
    PENDING = auto()
    APPROVED = auto()
    REJECTED = auto()
    PUBLISHED = auto()

class SubmissionType(Enum):
    DATA = auto()
    DESIGN = auto()
    VALIDATION_RULE = auto()

class ActionType(Enum):
    CREATE = auto()
    UPDATE = auto()
    DELETE = auto()
    PUBLISH = auto()
    VALIDATE = auto()

# Validation
class ValidationRule:
    def __init__(self, name: str, description: str, error_message: str, validation_func: callable):
        self.name = name
        self.description = description
        self.error_message = error_message
        self.validation_func = validation_func

    def validate(self, data: Any) -> bool:
        return self.validation_func(data)

class Validator:
    def __init__(self):
        self.rules: Dict[str, ValidationRule] = {}

    def add_rule(self, rule: ValidationRule) -> None:
        self.rules[rule.name] = rule

    def validate(self, data: Any, rule_names: Optional[List[str]] = None) -> Dict[str, str]:
        errors = {}
        rules_to_apply = self.rules.values() if rule_names is None else [self.rules[name] for name in rule_names if name in self.rules]

        for rule in rules_to_apply:
            if not rule.validate(data):
                errors[rule.name] = rule.error_message
        return errors

# Services
class SubmissionService:
    def __init__(self):
        self.validator = Validator()
        self.submissions: Dict[str, Dict] = {}
        self.logger = logging.getLogger('SubmissionService')
        self.setup_logging()

    def setup_logging(self) -> None:
        logging.basicConfig(level=logging.INFO, format='%(asctime)s - %(name)s - %(levelname)s - %(message)s')

    def submit(self, submission_type: SubmissionType, data: Dict, action: ActionType) -> Dict[str, str]:
        self.logger.info(f"Submitting {submission_type.name} with action {action.name}")
        errors = self.validator.validate(data)

        if errors:
            self.logger.error(f"Validation errors: {errors}")
            return errors

        submission_id = f"{submission_type.name}_{datetime.now().timestamp()}"
        self.submissions[submission_id] = {
            'type': submission_type,
            'data': data,
            'status': PublishStatus.PENDING,
            'action': action,
            'timestamp': datetime.now()
        }
        self.logger.info(f"Submission {submission_id} created successfully")
        return {}

    def get_published_files(self, submission_type: SubmissionType) -> List[Dict]:
        return [sub for sub in self.submissions.values() 
                if sub['type'] == submission_type and sub['status'] == PublishStatus.PUBLISHED]

class UIEditor:
    def __init__(self):
        self.versions: Dict[str, Dict] = {}
        self.logger = logging.getLogger('UIEditor')
        self.setup_logging()

    def setup_logging(self) -> None:
        logging.basicConfig(level=logging.INFO, format='%(asctime)s - %(name)s - %(levelname)s - %(message)s')

    def create_version(self, page_id: str, design_data: Dict) -> str:
        version_id = f"{page_id}_v{len(self.versions) + 1}"
        self.versions[version_id] = {
            'page_id': page_id,
            'design_data': design_data,
            'status': PublishStatus.DRAFT,
            'timestamp': datetime.now()
        }
        self.logger.info(f"Created new design version {version_id}")
        return version_id

    def submit_for_approval(self, version_id: str) -> bool:
        if version_id in self.versions:
            self.versions[version_id]['status'] = PublishStatus.PENDING
            self.logger.info(f"Design version {version_id} submitted for approval")
            return True
        return False

class DataService:
    def __init__(self):
        self.data_store: Dict[str, Dict] = {}
        self.logger = logging.getLogger('DataService')
        self.setup_logging()

    def setup_logging(self) -> None:
        logging.basicConfig(level=logging.INFO, format='%(asctime)s - %(name)s - %(levelname)s - %(message)s')

    def delete_data_by_date(self, target_date: datetime) -> int:
        deleted_count = 0
        keys_to_delete = [k for k, v in self.data_store.items() 
                         if v.get('timestamp') and v['timestamp'].date() == target_date.date()]

        for key in keys_to_delete:
            del self.data_store[key]
            deleted_count += 1

        self.logger.info(f"Deleted {deleted_count} records for date {target_date.date()}")
        return deleted_count

# Example usage
if __name__ == "__main__":
    # Initialize services
    submission_service = SubmissionService()
    ui_editor = UIEditor()
    data_service = DataService()

    # Add validation rule
    rule = ValidationRule(
        name="non_empty",
        description="Data should not be empty",
        error_message="Data cannot be empty",
        validation_func=lambda x: bool(x)
    )
    submission_service.validator.add_rule(rule)

    # Test submission
    submission_service.submit(
        SubmissionType.DATA,
        {"key": "value"},
        ActionType.CREATE
    )

    # Test UI design version
    ui_editor.create_version("home_page", {"color": "blue"})
    ui_editor.submit_for_approval("home_page_v1")

    # Test data deletion
    data_service.data_store = {
        "record1": {"timestamp": datetime.now(), "data": "test1"},
        "record2": {"timestamp": datetime(2020, 1, 1), "data": "test2"}
    }
    data_service.delete_data_by_date(datetime(2020, 1, 1))
